import FirstSection from '../components/Home/FirstSection';
import SecondSection from '../components/Home/SecondSection';
import ThirdSection from '../components/Home/ThirdSection';
const Home: React.FC = () => {
  return (
    <>
      <Head>
        <title>Bentcare | Home</title>
      </Head>
      <FirstSection />
      <SecondSection />
      <ThirdSection />
    </>
  );
};

export default Home;
